  return (
    <>
      <Box sx={{margin:'2rem 0'}}>
        <Paper elevation={0} sx={{padding:'2rem'}}>
          <Typography sx={{color:'#1565c0',letterSpacing:'3px',fontWeight:'bold'}}>Your Array : {JSON.stringify(array)}</Typography>

        {/* <Paper elevation={3} sx={{padding:'1rem'}}> */}
        <Typography>
            Selected activity: {selectedActivity && selectedActivity.label}
        </Typography>
        <Typography>
            Resultant array after applying {selectedActivity && selectedActivity.label} Method: - {JSON.stringify(array)}
        </Typography>
        </Paper>


        {/* </Paper> */}
      </Box>
    </>
  );
}
export default ResultantArray;
